import React, { useState } from 'react';
import { Calculator, AlertCircle, IndianRupee, Loader } from 'lucide-react';

const PriceCalculator = () => {
  const [formData, setFormData] = useState({
    weight: '',
    zone: 'default'
  });
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  const calculatePrice = async () => {
    if (!formData.weight || parseFloat(formData.weight) <= 0) {
      setError('Please enter a valid weight');
      return;
    }

    setLoading(true);
    setError('');

    try {
      const response = await fetch('http://localhost:5000/api/calculate-price', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          weight: parseFloat(formData.weight),
          zone: formData.zone
        })
      });

      const data = await response.json();

      if (!response.ok) {
        throw new Error(data.message || 'Failed to calculate price');
      }

      setResult({
        price: Number(data.price) || 0,
        estimatedDays: getEstimatedDays(formData.zone, parseFloat(formData.weight))
      });
    } catch (err) {
      console.error('Price calculation error:', err);
      setError(err.message);
    } finally {
      setLoading(false);
    }
  };

  const getEstimatedDays = (zone, weight) => {
    switch (zone) {
      case 'express':
        return '1-2';
      case 'international':
        return '7-10';
      default:
        return weight > 10 ? '4-5' : '2-3';
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData(prev => ({
      ...prev,
      [name]: value
    }));
    setError('');
    setResult(null);
  };

  return (
    <div className="max-w-2xl mx-auto">
      <div className="bg-white rounded-lg shadow-sm p-6">
        <div className="flex items-center gap-2 mb-6">
          <Calculator className="h-6 w-6 text-blue-600" />
          <h2 className="text-2xl font-bold text-gray-900">Calculate Shipping Cost</h2>
        </div>
        
        <div className="space-y-6">
          {/* Weight Input */}
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Package Weight (kg)
            </label>
            <div className="relative rounded-md shadow-sm">
              <input
                type="number"
                name="weight"
                value={formData.weight}
                onChange={handleChange}
                step="0.01"
                min="0"
                className="block w-full pr-12 pl-4 py-3 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
                placeholder="Enter weight"
              />
              <div className="absolute inset-y-0 right-0 pr-3 flex items-center pointer-events-none">
                <span className="text-gray-500 sm:text-sm">kg</span>
              </div>
            </div>
          </div>

          {/* Zone Selection */}
          <div>
            <label className="block text-sm font-medium text-gray-700 mb-2">
              Delivery Zone
            </label>
            <select
              name="zone"
              value={formData.zone}
              onChange={handleChange}
              className="block w-full px-4 py-3 border border-gray-300 rounded-md shadow-sm focus:ring-blue-500 focus:border-blue-500"
            >
              <option value="default">Standard Delivery</option>
              <option value="express">Express Delivery</option>
              <option value="international">International</option>
            </select>
          </div>

          {error && (
            <div className="flex items-center gap-2 text-red-600 bg-red-50 p-4 rounded-md">
              <AlertCircle className="h-5 w-5 shrink-0" />
              <span className="text-sm">{error}</span>
            </div>
          )}

          <button
            onClick={calculatePrice}
            disabled={loading}
            className="w-full flex items-center justify-center px-6 py-3 border border-transparent rounded-md shadow-sm text-base font-medium text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 disabled:opacity-50 disabled:cursor-not-allowed"
          >
            {loading ? (
              <>
                <Loader className="h-5 w-5 mr-2 animate-spin" />
                Calculating...
              </>
            ) : (
              <>
                <Calculator className="h-5 w-5 mr-2" />
                Calculate Price
              </>
            )}
          </button>

          {result && (
            <div className="mt-6">
              <div className="bg-green-50 rounded-lg p-6">
                <h3 className="text-lg font-medium text-green-900 mb-4">
                  Price Estimate
                </h3>
                <div className="space-y-4">
                  <div className="flex items-center justify-between">
                    <span className="text-green-700">Base Price</span>
                    <div className="flex items-center text-2xl font-bold text-green-700">
                      <IndianRupee className="h-6 w-6 mr-1" />
                      {typeof result.price === 'number' ? result.price.toFixed(2) : '0.00'}
                    </div>
                  </div>
                  <div className="border-t border-green-200 pt-4">
                    <div className="flex items-center justify-between text-sm text-green-600">
                      <span>Estimated Delivery Time</span>
                      <span className="font-medium">{result.estimatedDays} business days</span>
                    </div>
                  </div>
                </div>
              </div>

              <div className="mt-4 text-sm text-gray-500">
                <p className="flex items-start gap-2">
                  <AlertCircle className="h-5 w-5 shrink-0 mt-0.5" />
                  Note: Final price may vary based on actual weight and additional services.
                </p>
              </div>
            </div>
          )}

          {/* Pricing Information */}
          <div className="mt-8 border-t border-gray-200 pt-6">
            <h3 className="text-lg font-medium text-gray-900 mb-4">Pricing Information</h3>
            <div className="space-y-4">
              <div className="bg-gray-50 rounded-md p-4">
                <h4 className="text-sm font-medium text-gray-700 mb-2">Standard Delivery</h4>
                <ul className="text-sm text-gray-600 space-y-1">
                  <li>• Up to 1 kg: ₹100/kg</li>
                  <li>• 1-5 kg: ₹90/kg</li>
                  <li>• 5-10 kg: ₹80/kg</li>
                  <li>• 10-20 kg: ₹70/kg</li>
                  <li>• Above 20 kg: ₹60/kg</li>
                </ul>
              </div>

              <div className="bg-gray-50 rounded-md p-4">
                <h4 className="text-sm font-medium text-gray-700 mb-2">Express Delivery</h4>
                <p className="text-sm text-gray-600">
                  Additional 50% charge for express delivery with 1-2 business days delivery time.
                </p>
              </div>

              <div className="bg-gray-50 rounded-md p-4">
                <h4 className="text-sm font-medium text-gray-700 mb-2">International Shipping</h4>
                <p className="text-sm text-gray-600">
                  International rates vary by destination. Please contact support for specific rates.
                </p>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default PriceCalculator;
